import React from 'react';
import Noticia from './Noticia';

const Noticias = ({noticias}) => {
    return (
        <div className="row">
            {noticias.map(noticia =>{
                return(
                    <Noticia
                        key={noticia.url}
                        noticia={noticia}
                    />
                );
            })}
        </div>
    );
};

export default Noticias;
